import React from "react";
import './Dog.css'
import {Link} from 'react-router-dom';





const Dog = ({name, age, src,facts})=>{
    return(
        <div class="Dog">
            <img src={src} alt={name} />
            <div class="DogInfo">
                <Link to={`/dogs/${name}`}> {name} </Link> <br/><br/>
                Age: {age} 

            </div>
            <div class="facts">
                    <h6>Facts About {name}:</h6>
                    {facts.map(f=>(
                        <li>{f}</li>
                    ))}
                </div>


        </div>
    )

}

export default Dog;
